<p><a href="https://github.com/ssmichael1/satkit" target="_blank" rel="noopener noreferrer">satkit（Satellite Toolkit）</a>是一个高性能的航天动力学库，具有轨道预报、坐标转换、时间系统转换等航天动力学基础功能。</p>
